function run(argv) {

  app = Application.currentApplication()
  app.includeStandardAdditions = true
  path = app.chooseFile({ withPrompt: "Choose a TaskPaper document to work on", ofType: ["public.text"]})
  return path.toString().trim()

}

function run(argv) {
	var paths_to_open = JSON.parse(argv[0]);
	console.log('Opening: ' + paths_to_open)
	paths_to_open.forEach(function(path){
		Application('Finder').open(Path(path))
		//console.log(path)
	})
}

